import React, { Component } from 'react';
import ReactDom from 'react-dom';
import { Carousel,Item,Caption ,Card,Col} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.css';
import tata_safari from './vehicles/tata_safari.jpeg';
import jeeto from './vehicles/mahindra_jeeto.jpeg';
import scorpio from './vehicles/mahindra_scorpio.jpeg';



//create class for nav
class Courasel_style extends Component {

    render() {

        return (<div>
            <Col lg={12}>
            <Card  className=""  >
            <Carousel >
                <Carousel.Item >
                    <img
                        className="d-block"
                        src={jeeto}
                        alt="Jeeto"
                        heigt="100%"


                    />
                    <Carousel.Caption>
                        <h3>Jeeto</h3>

                    </Carousel.Caption>
                </Carousel.Item>
                <Carousel.Item>
                    <img
                        className="d-block w-80 h-80"
                        src={tata_safari}
                        alt="Safari"

                    />

                    <Carousel.Caption>
                        <h3>Safari</h3>
                    </Carousel.Caption>
                </Carousel.Item>
                <Carousel.Item>
                    <img
                        className="d-block w-80 h-80"
                        src={scorpio}
                        alt="Scorpio"

                    />

                    <Carousel.Caption className="text-dark">
                        <h3 className="text-dark">Scorpio</h3>
                    </Carousel.Caption>
                </Carousel.Item>
            </Carousel>
            </Card></Col>

        </div>)
    }
}

export default Courasel_style;
